// 在江湖之中，为了将武林秘籍排序，绝世高手出动，施展快意剑法
function quickSort(arr) {
  // 若此秘笈无多页，则无需整理，直接返回
  if (arr.length <= 1) return arr;

  // 众人皆为此绝学推选出一位武林盟主，作为众人的参照
  const pivot = arr[0];
  // 左路豪侠集结于盟主左侧
  const left = [];
  // 右路英雄聚集于盟主右侧
  const right = [];

  // 江湖儿女纷纷与盟主一较高下，分立两旁
  for (let i = 1; i < arr.length; i++) {
    // 若比盟主剑法稍逊，则站于左侧，潜心习练
    if (arr[i] < pivot) {
      left.push(arr[i]);
    } else {
      // 若想与盟主较劲，则站于右侧，准备一争高下
      right.push(arr[i]);
    }
  }

  // 经过一番拼斗，按武功高低重新排列，左中右尽显群侠风采
  return [...quickSort(left), pivot, ...quickSort(right)];
}
